playstore_details.description:
Spatium — is a unique keyless wallet that allows to easily and safely buy, store and send Bitcoin and other cryptocurrencies.  

FEEL SAFE WITH SPATIUM KEYLESS TECHNOLOGY

Spatium Wallet, based on SMPC technology and anonymous biometrics, allows you to manage digital assets without a Private Key. It is replaced with an encrypted set of secrets, distributed between your device and professional security provider. This means that:
- nobody except you has access to the funds;
- your funds will still be safe even if your device is hacked;
- even if you lose all credentials you can recover your wallet using your face.

This makes Spatium the safest and easiest crypto wallet no matter if you haven`t heard anything about Bitcoin before, or if you are an experienced crypto geek.

EASILY BUY AND SEND CRYPTO

- buy Bitcoin with a credit card in a few seconds at best prices; 
- use BTC, ETH, LTC, NEO or any of 150 other cryptocurrencies and tokens;
- instantly send Bitcoin and other crypto to any wallet around the world.

ENJOY USER-FRIENDLY INTERFACE AND SUPPORT

- our friendly support team is ready to help you 24/7;
- save contacts to favourites and make any operation with a few clicks;
- convenient access to transactions list and details.

MANAGE UNPRECEDENTED SECURITY

- easily establish limits for transactions to increase control over your funds;
- add privileged recipients to Whitelist;
- use simple backup with your anonymous biometric data.
